import { useState } from "react";
import { Button } from "react-bootstrap";


function ParkingPage(params) {

    const [latLng, updateLat]= useState();

    function getUserCurrentLocation() {

        function success(position) {
            const latitude  = position.coords.latitude;
            const longitude = position.coords.longitude;
            updateLat( { lat:latitude, lng:longitude} );
        }

        function error() {
            alert('Unable to retrieve your location');
        }


        if(!navigator.geolocation) {
            alert('Geolocation is not supported by your browser');
            } else {
            navigator.geolocation.getCurrentPosition(success, error);
        }

    }


    return(<div>
            <button onClick={()=> getUserCurrentLocation()}>Save Location</button>
            {typeof latLng !== undefined ?             <iframe
                width="600"
                height="450"
                style={{border:0}}
                loading="lazy"
                allowFullScreen
                src="https://www.google.com/maps/embed/v1/place?key=AIzaSyCNKfsXeTiMfS66RSVSMuYv5BEQVw5ohbI&q=סוקולוב 43 תל אביב">
            </iframe> : <div>NO Location</div>}

        </div> )
    }



export default ParkingPage
